import React, {Component} from 'react'
import cart from '../assets/images/cart.png'
import '../App.css'

class Navbar extends Component {
    render() {
        return (
            <div className="nav">
                <h1>Menu</h1>
                <img className="cart" src={cart}/>
            </div>
        )
    }
}
export default Navbar
